import React,{Component} from 'react';
import axios from 'axios';
import { CookiesProvider,useCookies,Cookies } from 'react-cookie';
import 'bootstrap/dist/css/bootstrap.min.css';
import './stylle.css';
import Userlist from './Userlist';
import { BrowserRouter as router,browserHistory, useHistory,Switch,Route,Link } from 'react-router-dom';
const cookies = new Cookies();    
class Indexx extends React.Component{
    constructor(props){
        super(props);
        this.state=({
            source:'',
            source_url:'',
            destination:'',
            destination_url:'',
        });
        this.onch1 = this.onch1.bind(this)
        this.onch2 = this.onch2.bind(this)
        this.onch3 = this.onch3.bind(this)
        this.onch4 = this.onch4.bind(this)
        this.onsub = this.onsub.bind(this)
     }
      onch1=(event)=>{
          this.setState({
              source:event.target.value
          })
      }
      onch2=(event)=>{
          this.setState({
            source_url:event.target.value
          })
      }
      onch3=(event)=>{
          this.setState({
              destination:event.target.value
          })
      }
      onch4=(event)=>{
          this.setState({
            destination_url:event.target.value
          })
      }
    onsub=()=>{
            let data = {
                source: this.state.source,
                source_url: this.state.source_url,
                destination: this.state.destination,
                destination_url: this.state.destination_url,
            }
                let dbname=this.state.source+this.state.source_url+this.state.destination+this.state.destination_url       
                let url = ' http://localhost:4000/userlist ';
                axios.post(url,data)
                .then(response=>console.log(response.data))
                .then(data => this.setState({ data }))
                .catch(e=>console.log(e));
                if(dbname){ 
                   const SC= cookies.set("name",dbname);
                   const GC=cookies.get('name');
                   console.log(GC);
                   this.props.history.push('/userlist');
                }else{
                    this.props.history.push('/');
                }
    }
    render(){        
        return(
            <div className="container" class="body">
                <h3>SEARCH</h3>
                <form action="" method="post" onSubmit={this.onsub} class="form" ><br/>
                    <label><b>Source</b></label>
                    <select name="source" onChange={this.onch1} >
                        <option value="">-{GC}-</option>
                        <option value="g_">Gsuite</option>
                        <option value="g_">0365</option>
                    </select>
                    <input type="text" name="source_url" placeholder="enter url" onChange={this.onch2} required/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <label><b>Destination</b></label>
                    <select name="destination" onChange={this.onch3} >
                        <option value="">-Select-</option>
                        <option value="__o_">Gsuite</option>
                        <option value="__o_">0365</option>
                    </select>
                    <input type="text" name="destination_url" placeholder="enter url" onChange={this.onch4} required/><br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <button className="btn btn-success"> View</button>
                </form>
             </div>   
        );
    }
}

export default Indexx;
